import React, { Component } from "react";

interface Props {
  col: any;
  cellHeight: any;
  cellWidth: any;
  key: any;
  row: any;
  isWall: any;
  onMouseDown: any;
  onMouseEnter: any;
  onMouseUp: any;
  mousePressed: any;
}

const Cell: React.FC<Props> = (props: any) => {
  const {
    col,
    cellHeight,
    cellWidth,
    isWall,
    onMouseDown,
    onMouseEnter,
    onMouseUp,
    row,
    mousePressed
  } = props;

  const style = {
    width: cellWidth ? cellWidth + "px" : "25px",
    height: cellHeight ? cellHeight + "px" : "25px",
    outline: ".1px solid rgb(175, 216, 248)",
    border: ".1px solid rgb(175, 216, 248)",
    display: "inline-block"
    // overflow: "hidden"
  };

  return (
    <>
      <defs>
        <pattern id="grid" width="80" height="80" patternUnits="userSpaceOnUse">
          <rect
            width="80"
            height="80"
            fill={"url(#smallGrid)"}
            onMouseDown={() => onMouseDown(row, col)}
            onMouseEnter={() => onMouseEnter(row, col)}
            onMouseUp={() => onMouseUp()}
            style={
              isWall
                ? {
                    backgroundColor: "rgb(12, 53, 71)",
                    ...style
                  }
                : style
            }
          />
          <path
            d="M 80 0 L 0 0 0 80"
            fill="none"
            stroke="gray"
            stroke-width="1"
          />
        </pattern>
      </defs>

      <rect
        onMouseDown={() => onMouseDown(row, col)}
        onMouseEnter={() => onMouseEnter(row, col)}
        onMouseUp={() => onMouseUp()}
        width="100%"
        height="100%"
        fill="url(#grid)"
      />
    </>
    // <td
    //   id={`node-${row}-${col}`}
    //   // className={`node ${extraClassName}`}
    //   onMouseDown={() => onMouseDown(row, col)}
    //   onMouseEnter={() => onMouseEnter(row, col)}
    //   onMouseUp={() => onMouseUp()}
    //    : style
    //   }
    // ></td>
  );
};

export default Cell;
